return $input.item;

const formatPhoneNumbers = (phones) => {
  if (!phones) return {
    telefone: "",
    telefone_2: ""
  }

  const entries = Object.values(phones).flat();  // Combine all phone arrays into one
  return {
    telefone: entries[0] || '',                  // First phone number or empty string
    telefone_2: entries[1] || ''                 // Second phone number or empty string
  };
};

const getWhatsappId = (phone) => {
  let result = phone.replace(/[^\d]/g, '').replace(/(\d{2})(\d{2})(9)(\d{4})(\d{4})/, '$1$2$4$5') + "@s.whatsapp.net"

  if (!result.startsWith('55')) {
    return '55' + result;  // Se não, adiciona '55' no início
  }

  return result;
}

const phones = formatPhoneNumbers($input.item.json.phoneNumbers);

return {
  contactId: $input.item.json.contactId,
  telefone: phones.telefone,
  telefone_2: phones.telefone_2,
  whatsappId: getWhatsappId(phones.telefone)
}

